import common.events.PagePartEvent;
// Add switch pages listener and handler
Moto.getInstance().eventDispatcher.addEventListener(MotoEvent.SWITCH_PAGE, switchPagesHandler);

function switchPagesHandler(event:Event):void
{
	if (!Object(event).extra)
    {
        return;
    }
	if (!Moto.getInstance().animationIsPlaying)
	{
		Moto.getInstance().animationIsPlaying = true;

		// Get current layout
		var currentLayout:uint = Moto.getInstance().currentLayout;		
		var previousLayout:uint = Moto.getInstance().previousLayout;

		switch (currentLayout)
		{
			case 1:
			{
				if (previousLayout == 2)
				{
					// Layouts 2 -> 1 transition
					gotoAndPlay("layout_2_out");
					Moto.getInstance().eventDispatcher.dispatchEvent(new PagePartEvent(PagePartEvent.CHANGE, "layout_2_out"));
				}
				break;
			}

			case 2:
			{
				if (previousLayout == 1)
				{
					// Layouts 1 -> 2 transition
					gotoAndPlay("layout_2_in");
					Moto.getInstance().eventDispatcher.dispatchEvent(new PagePartEvent(PagePartEvent.CHANGE, "layout_2_in"));
				}
				else
				{
					// Layouts 2 -> 2 transition
					gotoAndPlay("layout_2_rotate");
					//Moto.getInstance().eventDispatcher.dispatchEvent(new PagePartEvent(PagePartEvent.CHANGE, "layout_2_rotate"));
				}
				break;
			}
		}
	}
}

if (Moto.getInstance().currentPage > 1)
{	
	gotoAndPlay("layout_2_in");
	Moto.getInstance().eventDispatcher.dispatchEvent(new PagePartEvent(PagePartEvent.CHANGE, "layout_2_in"));
}
else
{
	stop();
	Moto.getInstance().animationIsPlaying = false;
}
